Description:
[t]Palmyre/[i]Tadmor[/i], sanctuaire de Baalshamîn. Deux consoles de colonne à tenon[/t]. 
[nl] [-x-]
[nl] (Photographie en noir et blanc) 
[nl] Inscription supérieure: console de colonne à tenon en calcaire dur et blanc avec une corniche moulurée. Dimensions: 50x46x86 cm. Le tenon mesure 20x43x20 cm. H. des lettres: 2 cm. Interlignes: 1.5 cm. L'inscription est mal conservée et on ne peut restituer que: &quot;Cette statue est celle de …, fils de …, fils de …,&quot; ainsi que &quot;parce qu'il leur a été agréable, au mois de … de l'an 414 (102/103 apr. J.-C.).&quot;

Inscription inférieure: console de colonne à tenon en calcaire dur, blanc avec une corniche moulurée très délitée (cf. IAS-COL-69547). Le corps de la console est structuré en deux registres. Dimensions: 46x43.6x72 cm. Le tenon mesure 40x16.5x16.5 cm. H. des lettres: 2 cm. Interlignes: 1 cm. Les lettres ont été tracées en peinture rouge. L'inscription est la suivante: &quot;Au mois de … de l'an 5.., cette statue est celle de Zabba, fils de Maqqaia, fils de Bôlhazai, fils de …, fils de Maqqaia, qui lui ont élevée les cavaliers de l'aile de Gamla et de Ana, parce qu'il leur a été agréable, en son honneur.&quot;

Les consoles ont été trouvées encastrées dans le mur sud des structures byzantines devant le [i]pronaos[/i], le 9 septembre 1954.
